int main(void)
{
    // declare other variables(not shown)
    // initialize location and direction of rectangles(not shown)
	
	
	// Set seed for randomization
	srand(time(NULL));
	
	/*
		Initial Setup
	*/
	
	setup();
	

    *(pixel_ctrl_ptr + 1) = 0xC0000000; // Set the back buffer
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // Use the back buffer first
	
	clear_screen();
	wait();

	bool first = true;
    while (1)
    {
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
        /* Erase any boxes and lines that were drawn in the last iteration */
 
		if(0 /*normal*/) elapsedTime = 10;
		if(1 /*fast*/) elapsedTime += 0.01;
		if(0 /*slow*/) elapsedTime = 1;
		
		handleIO();
		
		if (first) {
			drawBackground();
		}
		
		if (!first) {
			// Delete previous screen
			/*
			for (int y = 0; y < RES_Y / 2; y++) {
				for (int x = 0; x < RES_X; x++) {
					plot_pixel(x, y, BLUE);
				}	
			}
			*/
			
			// Copy previous frame
			for (int y = 0; y < RES_Y; y++) {
				for (int x = 0; x < RES_X; x++) {
					prevFrame[y][x] = frame[y][x];
				}	
			}
						
		}
		
		//distance = distance < 0 ? (RES_Y/2)  - distance : distance;
		mappingRow = ((int)distance) % (RES_Y / 2);
		drawScreen();
		flush_frame();
		
		// Update distance synthetically
		distance += 2 * speed ;
		//printf("%f\n", distance);
		

        wait(); // swap front and back buffers on VGA vertical sync
        
    
		first = false;
	}
}

void handleIO() {
	
	volatile int* key_ptr = KEY_BASE;
	volatile int key0 = *key_ptr;
		
	// Moving forward
	if (key0 & 0b01) {
		speed += 5;
	} else { // Stopping
		speed -= 2;
	}
	
	// Turning left only when moving forward
	if (key0 & 0b01000) {
		driverCurvature -= 0.05;
	} 
	// Turning right only when moving forward
	else if (key0 & 0b00100) {
		driverCurvature += 0.05;	
	} else {
		
		driverCurvature *= 0.99; // reduce curvature 	
	}
	
	
	
	
		
	// Clamp turning
	//if (driverCurvature > 1) driverCurvature = 1;
	//if (driverCurvature < -1) driverCurvature = -1;
	
	
	// Check if off track
	//if (ABS(driverCurvature - trackCurvature) >= 0.70) { 
	
	if (carPos < leftEdge || carPos + 80 > rightEdge) {
		speed -= 4;
		
		printf("OFF TRACK\n");
		
		// Push the car outwards if user is not giving input
		//if (driverCurvature > 0) {
		//	if (!(key0 & 0b01000)) {
		//		driverCurvature += (speed / MAX_SPEED);
		//	}
		//} else if (driverCurvature < 0) {
		//	if (!(key0 & 0b00100)) {
		//		driverCurvature -= (speed / MAX_SPEED);
		//	}
		//}
		//driverCurvature = (driverCurvature > 0) ?driverCurvature + 0.05 : driverCurvature - 0.5;
		
		MAX_SPEED = 5;
	} else {
		MAX_SPEED = 20;
	}
	
	
	// Clamp speed
	if (speed > MAX_SPEED) speed = MAX_SPEED;
	if (speed < 0) speed = 0;

}

void drawScreen () {
	
	// Find the curvature
	float trackOffset = 0;
	int trackIdx = 0;
	
	while (trackIdx < TRACK_SIZE && trackOffset <= distance) {
		trackOffset += track[trackIdx][1];
		trackIdx++;
	}
	
	// If on a new track, get the time stamp
	if (trackIdx != prevTrackIdx) {
		curTrackTime = 0;
	}
	
	float trackSegmentCurvature = track[trackIdx][0];
	//printf("%d\n", trackIdx);
	
	float curvatureDiff = (trackSegmentCurvature - curvature) * curTrackTime * speed / MAX_SPEED;
	curvature += curvatureDiff;
	trackCurvature = curvature;
	
	// Draw the track
	for (int y =  RES_Y / 2; y < RES_Y; y++) {
		for (int x = 0; x < RES_X; x++) {
			
			float perspective = (float)(y - (RES_Y / 2.0)) / (RES_Y / 2.0);
			
			float midPoint = 0.5 + curvature * (1 - perspective) * (1 - perspective) * (1 - perspective);
			float roadWidth = 0.8 * perspective + 0.1;
			float clipWidth = roadWidth * 0.15;
			
			roadWidth *= 0.5;
			
			// Road borders
			float roadShift = -0.5 * carPosDelta;
			
			int leftGrass = (midPoint - roadWidth - clipWidth) * RES_X + roadShift;
			int leftClip = (midPoint - roadWidth) * RES_X + roadShift;
			
			int rightGrass = (midPoint + roadWidth + clipWidth) * RES_X + roadShift;
			int rightClip = (midPoint + roadWidth) * RES_X + roadShift;
			
			
			
			
			// Find the outer edge at the level of the car for collisions
			if (y == 0.8 * RES_Y) {
				leftEdge = leftGrass;
				rightEdge = rightGrass;
			}
			
			int grassColor = (grassMapping[mappingRow][(y - (RES_Y / 2))] == 1) ? GREEN : DARK_GREEN;
			int clipColor = (clipMapping[mappingRow][(y - (RES_Y / 2))] == 1) ? WHITE : RED;

			if (x >= 0 && x < leftGrass) { // Left Grass
				draw_pixel(x, y, grassColor);
			}
			if (x >= rightGrass && x < RES_X) {
				draw_pixel(x, y, grassColor);
			}	
			if (x >= leftGrass && x < leftClip) { // Left Clip
				draw_pixel(x, y, clipColor);
			}
			if (x >= leftClip && x < rightClip) {
				draw_pixel(x, y, GREY);
			}
			if (x >= rightClip && x < rightGrass) {
				draw_pixel(x, y, clipColor);
			}
					
		}
		
		
	}
	
	// draw car
	drawCar();
	
	//draw the skyline
	//drawBackground();
	
	//draw time and laps
	drawTime(elapsedTime, trackIdx);
	
	// Update the current Track time
	curTrackTime += track[trackIdx][2];
	// Set the current track idx as previous
	prevTrackIdx = trackIdx;
	
	if (trackIdx + 1 >= TRACK_SIZE) { // At the end of track
		distance = 0;
		curTrackTime = 0;
	}
	
	
}

void drawCar() {
	
	carPosDelta = (driverCurvature - trackCurvature) * 0.5 * RES_X;
	//printf("%f\n", carPosDelta);
	
	
	int base_y = 0.8 * RES_Y - 30;
	int base_x = 0.5 * RES_X + carPosDelta - 40;
	//printf("%d\n", base_x);
	// Clamp horizontal position
	if (base_x < 0) base_x = 0;
	if (base_x > RES_X - 80) base_x = RES_X - 80;
	
	carPos = base_x;
	
	for (int y = 0; y < 2 * 30; y++) {
		for (int x = 0; x < 2 * 40; x++) {
			int x_ = (x / 2);
			int y_ = (y / 2);
			int loc = ((40 * y_) + x_ );
			int color = car[loc];
			if (color == 0) continue;
			draw_pixel(base_x + x, base_y + y, color);
			
		}
		
	} 
	
	
}

void drawBackground() {
	
	int base_y = 0;
	int base_x = 0;
	
	for (int y = 0; y < 120; y++) {
		for (int x = 0; x < RES_X; x++) {
			int loc = ((320 * y) + x);
			int color = background[loc];
			//printf("%d\n", background[loc]);
			if (color == 0) continue;
			draw_pixel(base_x + x, base_y + y, color);
		}
		
	} 
	
}


void drawTime(float elapsedTime, int trackIdx){
	char timeStr[10];
	sprintf(timeStr, "%.2f", elapsedTime);
	int base_y = 10;
	int base_x = 10;
	
	for (int i = 0; i < 4; i++){
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(letters[i][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		
		base_x += 10;
	}
	
	base_y += 10;
	base_x = 10;
	int indexNumber;
	
	for(int i = 0; i < strlen(timeStr); i++){
		if (timeStr[i] == '.'){
			indexNumber = 10;
		}
		
		else{
			indexNumber = timeStr[i] - '0';
		}
		
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(numbers[indexNumber][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		
		base_x += 10;
	}
	
	base_x = RES_X - 50;
	base_y = 10;
	
	for (int i = 4; i < 8; i++){
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(letters[i][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		
		base_x += 10;
	}
	
	
	// display laps
	base_x = RES_X - 50;
	base_y += 10;
	int ids[3] = {trackIdx, 11, TRACK_SIZE};
	
	for(int i = 0; i < 3; i++){	
		for (int j = 0; j < 25; j++){
			int x = j/5;
			int y = (j - 5*x);
			if(numbers[ids[i]][j] == 1){
				draw_pixel(base_x + y, base_y + x, BLACK);
			}
		}
		base_x += 10;
	}
}


// code for subroutines (not shown)
// Performs the buffer swap
void wait() {

	register int status;
	
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0x01) != 0) {
		status = *(pixel_ctrl_ptr + 3);
	}
		
}

bool in_bounds (int x, int y, int dx, int dy) {
	int tx = x + dx;

	int ty = y + dy;
	
	if (tx - 1 < 0 || tx + 1 >= RES_X || ty - 1 < 0 || ty + 1 >= RES_Y) {
		return false;
	}

	return true;	
}

// code not shown for clear_screen() and draw_line() subroutines
void clear_screen() {
	for (int x = 0; x < RES_X; x++) {
		for (int y = 0; y < RES_Y; y++) {
			plot_pixel(x, y, 0x0000);	
		}
	}	
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color) {
	
	// First plot the boxes at the endpoints
	plot_box(x0, y0, line_color);
	
	bool is_steep = abs(y1 - y0) > abs(x1 - x0);
		
	if (is_steep) {
		int tempA = x0;
		int tempB = x1;
		
		// Swap
		x0 = y0;
		x1 = y1;
		
		y0 = tempA;
		y1 = tempB;
	}
	
	if (x0 > x1) {
		int tempA = x0;
		int tempB = y0;
		
		// Swap
		x0 = x1;
		y0 = y1;
		
		x1 = tempA;
		y1 = tempB;
	}
	
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax / 2);
	int y = y0;
	int y_step = (y0 < y1) ? 1 : -1;
	
	for (int x = x0; x <= x1; x++) {
		if (is_steep) {
			plot_pixel(y, x, line_color);
		} else {
			plot_pixel(x, y, line_color);
		}
		
		error = error + deltay;
		if (error > 0) {
			y = y + y_step;
			error = error - deltax;		
		}
	}
}

void plot_box(int x, int y, short int color) {

	// endpoints of the box
	
	
	int x0 = x - 1;
	int x1 = x + 1;
	int y0 = y - 1;
	int y1 = y + 1;
	
	for (int i = x0; i <= x1; i++) {
		for (int j = y0; j <= y1; j++) {
			plot_pixel(i, j, color);	
		}	
	}	
}

